import React, { useEffect, useState ,useRef } from "react";
import axios from "axios";


const API1 = () => {
    var [date, setData] = useState([])
    useEffect(() => {
        axios.get('https://geton.skmbpk1z.a2hosted.com/get-data.php').then(function (abc) {
            setData(abc.data);
        })
    }, [])

    return (
        <>
            <table border={1} cellPadding={3} cellSpacing={7}>
                <tr>
                    <th>id</th>
                    <th>name</th>
                    <th>email</th>
                    <th>password</th>
                </tr>
                {
                    date.map((e) => {
                        return (
                            <>
                                <tr>
                                    <td>{e.id}</td>
                                    <td>{e.name}</td>
                                    <td>{e.email}</td>
                                    <td>{e.password}</td>
                                </tr>
                            </>
                        )
                    })
                }
            </table>
        </>
    )
}

export default API1;
